            WriteLiteral(@"            <div class=""content active"">
                        <p>Bəli, Siz məhsulları 24 ayadək hissə-hissə ödəniş şərtlərilə əldə edə bilərsiniz. Əksər məhsullar 18 ayadək Faizsiz hissə-hissə ödəniş şərtlərilə, İlkin ödənişsiz, iş yerindən arayış tələb olunmadan təqdim olunur.</p>
