                    </li>
                    <div class=""content"">
                        <p>Kontakt Home mağazalarından istər nağd, istərsə də hissə-hissə ödənişlə əldə olunan bütün məhsulların ödənişi yalnız Azərbaycan Respublikasının milli valyutası – Azərbaycan manatı ilə hesablanır.</p>
                    </div>
                    <li>
                        <h5>
                            <span>
