                                </svg>
                            </span>Sifariş edilən məhsul neçə günə çatdırılır?
                        </h5>
                    </li>
                    <div class=""content"">
                        <p>Sifarişiniz onlayn satış təmsilçisinin zəng edib məhsulu adınıza rəsmiləşdirməsi ilə yekunlaşır. Kiçik məişət texnikası, 32 düym və daha kiçik TV, rəqəmsal məhsul və ya aksessuar əldə etdiyiniz təqdirdə, sifarişiniz növbəti gün ərzində ünvana çatdırılacaq. Lakin qeyd edək ki, məhsul yalnız bölgə mağazalarımızda olsa və həmin mağazadan satış edilsə çatdırılma məsafə ilə əlaqədar 14 gün ərzində həyata keçirilə bilər.</p>
                        <p>32 düymdən böyük TV və ya böyük məişət texnikası əldə etdiyiniz təqdirdə sifarişiniz nağddırsa növbəti gün ərzində, hissəvi şərtlərlə və ya taksitlə alışdırsa 3 iş günü ərzində ünvanınıza çatdırılacaq. Yekun çatdırılma müddəti barədə sizə zəng zamanı satı");
