                            </span>Aylıq ödənişimi onlayn formada necə həyata keçirə bilərəm?
                        </h5>
                    </li>
                    <div class=""content"">
                        <p>İstifadə etdiyiniz bank kartının imkanlarından asılı olaraq, istənilən Visa və ya Mastercardla ödənişinizi onlayn şəkildə MilliÖn, hesab.az və ya Azərbaycan Respublikasının Mərkəzi Bankının <strong>“AniPay” mo");
            WriteLiteral(@"bil tətbiqi </strong>vasitəsi ilə vasitəsilə həyata keçirə bilərsiniz. Bunun üçün aşağıdakı linklərdən birinə keçməyiniz kifayətdir:</p>
                        <p>&nbsp;</p>
                        <p><a href=""http://www.million.az/attributes/KontaktHome"">www.million.az/attributes/KontaktHome</a></p>
                        <p>&nbsp;</p>
                        <p><a href=""https://www.bit.ly/hesabaz_KontaktHome"">www.bit.ly/hesabaz_KontaktHome</a></p>
                        <p>&nbsp;</p>
                        <p>Aylıq ödənişləri necə həyata keçirməli sualına ətraflı cavab tapmaq üçün <a href=""https://bit.ly/Aylıq_Ödəniş"">https://bit.ly/Aylıq_Ödəniş</a> linkinə keçməyinizi xahiş edirik. Burada siz aylıq ödənişləri digər hansı üsullarla həyata keçirə biləcəyinizi, FİN (PIN) kod və müqavilə nömrəsi haqqında, həmçinin, taksit kartları ilə alış zamanı ödəniş barədə məlumatı əldə edəcəksiniz.</p>

                    </div>
                    <li>
                        <h5>
                        ");
            WriteLiteral(@"    <span>
                                <svg enable-background=""new 0 0 240.823 240.823"" version=""1.1"" viewBox=""0 0 240.823 240.823"" xml:space=""preserve"" xmlns=""http://www.w3.org/2000/svg"">
