                                </svg>
                            </span>Məhsulu bəyənməsəm geri qaytara bilərəm?
                        </h5>
                    </li>
                    <div class=""content"">
                        <p>Kontakt Home mağazalarından əldə etdiyiniz məhsulu alınma günü nəzərə alınmamaq şərti ilə, 14 təqvim günü ərzində dəyişdirə və ya qaytara bilərsiniz. Məhsul istifadə edilməyibsə, əmtəə görünüşü pozulmayıbsa, komplektasiyası tamdırsa və satış qəbzi mövcuddursa, geri qaytarılması mümkündür.</p");
            WriteLiteral(@">
                    </div>
                    <li>
                        <h5>
                            <span>
