                    </li>
                    <div class=""content"">
                        <p>Ən böyü");
            WriteLiteral(@"k mağazalarımız siyahısına Ukrayna dairəsi və 10-cu mkr Sumqayıt aiddir. Onlar öz seqmentində Qafqazın ən böyük mağazalarıdır&nbsp; və bu mağazalarda sizə geniş məhsul çeşidi təqdim edirik.</p>
                        <p>Mağazalarımızın ünvanına <a href=""https://kontakt.az/magazalar/"">https://kontakt.az/magazalar/</a> &nbsp;linkinə keçid edib baxa bilərsiniz.</p>
                    </div>
                    <li>
                        <h5>
                            <span>
                                <svg enable-background=""new 0 0 240.823 240.823"" version=""1.1"" viewBox=""0 0 240.823 240.823"" xml:space=""preserve"" xmlns=""http://www.w3.org/2000/svg"">
