                                </svg>
                     ");
            WriteLiteral(@"       </span>Çatdırılma ödənişsiz həyata keçirilir?
                        </h5>
                    </li>
                    <div class=""content"">
                        <p>Onlayn sifariş və çatdırılma xidməti pulsuzdur. Yalnız dəyəri 50 AZN-dən az olan sifarişlərin çatdırılması üçün 3 AZN ödəniş tələb olunur.</p>
