                                <path d=""m57.633 129.01l108.3 108.26c4.752 4.74 12.451 4.74 17.215 0 4.752-4.74 4.752-12.439 0-17.179l-99.707-99.671 99.695-99.671c4.752-4.74 4.752-12.439 0-17.191-4.752-4.74-12.463-4.74-17.215 0l-108.3 108.26c-4.679 4.691-4.679 12.511 0.012 17.191z""></path>
                                </svg>
                            </span>Saytınızdan məhsul sifariş e");
            WriteLiteral(@"tdikdən sonra ləğvi mümkündür?
                        </h5>
                    </li>
                    <div class=""content"">
                        <p>Bəli, sifarişinizi ləğv etmək istədiyiniz zaman *6060 Çağrı Mərkəzinə zəng edə və yaxud <a href=""https://kontakt.az/wp-content/themes/kontakt7/ktn-assets/assets/2021/wp.png"">https://wa.me/9945082860600508286060</a> rəsmi WhatsApp nömrəmizə yaza bilərsiniz. Həmçinin, rəsmi “Kontakt Home” Facebook və kontakt_home Instagram səhifələrimizdə mesaj bölməsində bizə yazaraq müraciət etməyiniz də mümkündür.</p>
